    false,nt"url": null,nt"notes": " n        The specific objectives of this
    evaluation are threefold:nn- Performance evaluation of project activities, like
    the mid-term evaluation, based on elements related to relevance, efficacy, efficiency,
    coherence, and sustainability.n- Measurement of noticeable results at the end of
    the Compact, including effects and impacts (both positive and negative, expected
    or unexpected) on beneficiaries, institutions, project governance, and the environment,
    as well as the perceived change among stakeholders, including community members
    in the project areas, regarding the project itself and the results achieved.n- Analysis
    of the degree to which project mid-term evaluation recommendations were implemented,
    to see if they affected project performance.nnThe evaluation will also make recommendations
    for strengthening and capitalizing on project results and draw lessons to build
    upon during the design and implementation phase of similar projects in the future.n
